, 'created_at': '2022-03-29T21:02:34Z', 'updated_at': '2022-04-05T18:23:27Z', 'closed_at': None, 'author_association': 'NONE', 'active_lock_reason': None, 'body': '### This issue is a: 
- [x] bug report
- [ ] documentation issue or request
- [ ] regression (a behavior that used to work and stopped in a new release)

### Issue description
When developing an ARM/Bicep template for container app provisioning we are running into a deployment validation failure when attempting to use a referenced value in the `registries.server` property.

### Example Bicep Template
```bicep
# Azure Container Registry
resource registry 'Microsoft.ContainerRegistry/registries@2021-12-01-preview' = {
  name: 'acr${envname}'
  location: location
  sku: {
    name: 'Standard'
  }
  properties: {
    adminUserEnabled: true
    anonymousPullEnabled: false
    dataEndpointEnabled: false
    encryption: {
      status: 'disabled'
    }
    networkRuleBypassOptions: 'AzureServices'
    publicNetworkAccess: 'Enabled'
    zoneRedundancy: 'Disabled'
  }
}
 
# Azure Container app
resource web 'Microsoft.App/containerApps@2022-01-01-preview' = {
  name: '${envname}web'
  location: location
  properties: {
    managedEnvironmentId: environment.id
    configuration: {
      activeRevisionsMode: 'single'
      ingress: {
        external: true
        targetPort: 3000
        transport: 'auto'
      }
      secrets: [
        {
          name: 'registry-password'
          value: registry.listCredentials().passwords[0].value
        }
      ]
      registries: [
        {
          server: registry.properties.loginServer # <-- Failing validation here
          username: registry.name
          passwordSecretRef: 'registry-password'
        }
      ]
    }
    template: {
      containers: [
        {
          image: 'mcr.microsoft.com/azuredocs/containerapps-helloworld:latest'
          name: 'main'
        }
      ]
    }
  }
}
```

The resulting ARM template looks like this:
```json
...
"registries": [
  {
    "server": "[reference(resourceId('Microsoft.ContainerRegistry/registries', format('acr{0}', parameters('envname')))).loginServer]",
    "username": "[format('acr{0}', parameters('envname'))]",
    "passwordSecretRef": "registry-password"
  }
]
...
```

### Steps to reproduce
1. Create ARM/Bicep template with registry server reference to ACR
2. Deploy template via az CLI

**Expected behavior** 
Deployment should accept the valid reference and succeed.  Appears that the expression is being evaluated without interpolating the referenced value.

**Actual behavior** 
Deployment validation failure
```
Property 'registries.server' has an invalid value '[reference(resourceId('Microsoft.ContainerRegistry/registries', format('acr{0}', parameters('envname')))).loginServer]'. A value must consist of lower case alphanumeric characters, '-' or '.', and must start and end with an alphanumeric character."}
```

### Additional context
Issues occurs through the CLI
